import React, { Component } from 'react';
import pageOne from './images/pg1.jpg';

class SmallCardPanel extends Component {
	render () {
		return (
			<div>
				<h1 className="display-1 text-center">Small Card Panel</h1>
				<div className="container">
					<div className="row">
						<div className="col-4 text-center">
							<img src={pageOne} />
						</div>
						<div className="col-4 text-center">
							<img src={pageOne} />
						</div>
						<div className="col-4 text-center">
							<img src={pageOne} />
						</div>
					</div>
				</div>
			</div>
		);
	}
}

export default SmallCardPanel;
